import { createIcon } from "../icon/createIcon";

export const SumSolidIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="SumSolidIcon">
    <path d="M12 0H0l4.183 6L0 12h12V7.385H8.992v1.634H6L8 6 6 3h3l-.008 1.615H12z" />
  </svg>,
  "SumSolid",
  "sum solid"
);
